import React from "react";
import { BrowserRouter as   RRoutes, BrowserRouter } from 'react-router-dom';
import './App.css';
import Navbar from "./components/Navbar/Navbar";
import Home from "./pages/Home/Home"; // Import your Home component or other pages

function App(){
    return (
        <div>
            <BrowserRouter>
                <Navbar />
                <Routes>
                    <Route path="/" element={<Home />} />
                    {/* Define your routes here */}
                    {/* Example: <Route path="/" element={<Home />} /> */}
                </Routes>
                
            </BrowserRouter>
        


        </div>
        
    );

}

export default App;
